DROP DATABASE IF EXISTS CYBORG_ITSM;
CREATE DATABASE CYBORG_ITSM;
USE CYBORG_ITSM;


CREATE TABLE OPERARIO (
	ID_OPE INT AUTO_INCREMENT PRIMARY KEY ,
	NOM_OPE VARCHAR (25),
	APE_OPE VARCHAR (25),
	TDO_OPE VARCHAR (4),
	NRO_OPE CHAR (12) UNIQUE NOT NULL,
	TDC_OPE VARCHAR (15),
	CAR_OPE VARCHAR (15) ,
	DIR_OPE VARCHAR(50),
	TEL_OPE CHAR (10),
	RH_OPE  VARCHAR (4),
	EMA_OPE VARCHAR (50),
	EPS_OPE VARCHAR (20),
	ARL_OPE CHAR (10),
	FOT_OPE VARCHAR (50),
	SES_OPE INT (1) 
	);

CREATE TABLE SUPERVISOR (
		ID_SUP INT AUTO_INCREMENT PRIMARY KEY ,
		APE_SUP VARCHAR (25), 
		NOM_SUP VARCHAR (25), 
		USE_SUP VARCHAR (25), 
		PAS_SUP VARCHAR (25), 
		CAR_SUP VARCHAR (25), 
		FOT_SUP VARCHAR (50), 
		SES_SUP INT (1) 
	);

CREATE TABLE NOVEDAD (
	ID_NOV INT AUTO_INCREMENT PRIMARY KEY,
	TIP_NOV varchar(25) DEFAULT NULL,
	FEC_NOV varchar(25) DEFAULT NULL,
	DES_NOV varchar(200) DEFAULT NULL,
	FOT_NOV varchar(50) DEFAULT NULL,
	ID_SUP int(11) NOT NULL
);
CREATE TABLE SOLICITUD (
	ID_SOL INT AUTO_INCREMENT PRIMARY KEY,
	TIP_SOL varchar(25) DEFAULT NULL,
	FEC_SOL varchar(25) DEFAULT NULL,
	DES_SOL varchar(200) DEFAULT NULL,
	FOT_SOL varchar(50) DEFAULT NULL,
	EST_SOL varchar(10) DEFAULT NULL,
	DET_SOL varchar(100) DEFAULT NULL,
	ID_OPE int(11) NOT NULL
);


CREATE TABLE REGISTROS (
		ID_REG INT AUTO_INCREMENT PRIMARY KEY,
		DOC_REG VARCHAR(20) NOT NULL,
		NOM_REG VARCHAR(100) NOT NULL,
		APE_REG VARCHAR(100) NOT NULL,
		FEC_REG DATE NOT NULL,
		HOR_REG TIME NOT NULl,
		ACCION ENUM ('ingreso','salida') NOT  NULL,

		FOREIGN KEY (DOC_REG) REFERENCES OPERARIO(NRO_OPE)
	);
	


	

	